pragma solidity ^0.4.23;

import "./Tierline.sol";

contract TierPricing is Tierline {
    uint256 ETH_USD;
    uint256 preICOtokensPerETH;
    uint256 ICOTier1tokensPerETH;
    uint256 ICOTier2tokensPerETH;
    uint256 ICOTier3tokensPerETH;
    uint256 ICOTier4tokensPerETH;

    function getTokensPerETH() 
    public 
    view 
    purchaseAllowed 
    returns (uint256) 
    {
        Rounds round = getTier();
        if (round == Rounds.preICO) {
            return preICOtokensPerETH;
        } else if (round == Rounds.ICORound1) {
            return ICOTier1tokensPerETH;
        } else if (round == Rounds.ICORound2) {
            return ICOTier2tokensPerETH;
        } else if (round == Rounds.ICORound3) {
            return ICOTier3tokensPerETH;
        } else if (round == Rounds.ICORound4) {
            return ICOTier4tokensPerETH;
        }
    }

    modifier purchaseAllowed() {
        Rounds round = getTier();
        require(round != Rounds.preWhitelist);
        require(round != Rounds.Whitelist);
        _;
    }
}
